import React from "react";
import Estilo from "../Hojas de Estilos/ItemMenu.css";
function ItemMenu({props, posicion ,linkActivo , setActivo}){
    return(
        <a className={linkActivo? "item-menu activo" : "item-menu" } onClick={()=>{setActivo(posicion)}}>
            {props.children}
        </a>
    );
}
export default ItemMenu;
